//create RDD
val historicalData = sc.textFile("/tmp/GEM-GHEC-v1.txt")

//define the schema
val globalInstrumentalCatalogData = sc.textFile("/tmp/isc-gem-cat.csv")
case class EarthQuake(
id: String,
date: String,
lat: Double,
lon: Double,
depth: Double,
mag: Double,
munc: Double
)

//clean up the records. Delimit by tabs and peel out the year/month
//remove unwanted data entries
val historical = historicalData.filter(s =>
!s.startsWith("#") && !s.startsWith("En\tSource")
).map{s=>
//make a function to peel out the year
def get(s:String) = {
if (s=="") {
"00"
} else {
s
}
}
val r = s.split("\t")
val year = r(2) // year
if (r(2) != "") {
val month = r(2)
} else {
//...and peel out the month
val month = "00"
}
//format the date
val date = r(2) + "-" + get(r(3)) + "-" + get(r(4)) + " " + get(r(5)) + ":" + get(r(6)) + ":" + get(r(7)) + ".00"

//extract interesting earthquake data:  id, date, depth, magnitude, "uncorrected" magnitude
EarthQuake(
r(0).toString, // id
date,
get(r(9)).toDouble,
get(r(10)).toDouble,
get(r(14)).toDouble, // depth
get(r(17)).toDouble, // mag
get(r(18)).toDouble // mag unc

)
}

val earthQuake = globalInstrumentalCatalogData.filter(!_.startsWith("#")).map{s=>
val r = s.split(",")
EarthQuake(
r(23).trim,
r(0).trim,
r(1).toDouble,
r(2).toDouble,
r(7).toDouble,
r(10).toDouble,
r(11).toDouble
)
}.union(historical).toDF   //make a dataframe
//make a table to query
earthQuake.registerTempTable("eq")

